const featureFlags = {
  FeatureFlagOn: true,
  FeatureFlagOff: false,
};
function isFeatureEnabled(Env) {
  if(Env === 'Dev'){
    return featureFlags[FeatureFlagOn] === true;
  }else{
    return featureFlags[FeatureFlagOff] === false;
  }
}
export default isFeatureEnabled
